import rootUrl from "./rootUrl";
const fetch = require("node-fetch");

export default function getItems({query} = {}){
    const url = rootUrl("dev") + `/items?search=${query}`;
    fetch(url)
    .then(res => res.json())
    .then(res => {console.log(res);
        return res;
    })
    .catch(err => console.log(err));
    return [];
}
